import "./Scroll.css";
import { BsSkipEnd } from "react-icons/bs";
export default function Scroll() {
  return (
    <div className='scroll-wrapper'>
      <button className="btn_scroll"></button>
      <span className="btn_scroll-icon">
        <BsSkipEnd className="test1" />
      </span>
    </div>
  );
}
